import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import LoginScreen from './screens/LoginScreen';
import RegisterScreen from './screens/RegisterScreen';
import HomeFage1 from './screens/HomeFage1'
import HelpFage from './screens/HelpFage';
import HomeFage2 from './screens/HomePage2';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="HomeFage2" >
        <Stack.Screen name="Login" component={LoginScreen} options={{ headerShown: false}}/>
        <Stack.Screen name="Register" component={RegisterScreen} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>
        <Stack.Screen name="HomeFage1"  component={HomeFage1} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>
        <Stack.Screen name="HelpFage"  component={HelpFage} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>
          <Stack.Screen name="HomeFage2"  component={HomeFage2} options={({ navigation }) => ({
    headerTitle: '', // Đặt tiêu đề trống rỗng
    headerBackTitle: 'Trở lại', // Đặt văn bản cho nút back
    headerShown: true, // Hiển thị header
  })}/>

      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
